function ViewTickets(){$.ajax({url:"https://localhost:44370/MaintenanceManager/GetTickets",type:"GET",dataType:"JSON",success:OnSuccess})}function OnSuccess(n){var t=n;list=document.getElementById("TicketsList");t.forEach(n=>{li=document.createElement("li"),li.innerText=n,list.appendChild(li)})}function ViewBuilding(){$.ajax({url:"https://localhost:44370/MaintenanceManager/GetTicket",type:"GET",success:OnSuccess})}function OnSuccess(n){var t=n;$("#TicketId").html(t.Id);$("#BuildingManagerComment").html(t.BuildingManagerComment);$("#BeneficiaryID").html(t.BeneficiaryID);$("#Status").html(t.Status);$("#Date").html(t.Date);$("#Description").html(t.Description)}